function drawChart(year) {
      document.getElementById("selectYear0").style.display = "none";
      document.getElementById("selectYear1").style.display = "none";
      var chartData6 = allYearData[2000];
      if (year == 0){
      	chartData6 = allYearData[2000];
      	for (var i=1;i<allYearData[2004].length;i++) {
      		chartData6.push(allYearData[2004][i]);
      	}
      	for (var i=1;i<allYearData[2008].length;i++) {
      		chartData6.push(allYearData[2008][i]);
      	}
      	for (var i=1;i<allYearData[2012].length;i++) {
      		chartData6.push(allYearData[2012][i]);
      	}
      	for (var i=1;i<allYearData[2016].length;i++) {
      		chartData6.push(allYearData[2016][i]);
      	}
      }
      else if (year > 1998) {
      	chartData6 = allYearData2000[year];
      }
      else {
      	chartData6 = allYearData[year];
      }
      
      var data = google.visualization.arrayToDataTable(chartData6);

      var options = {
        title: 'Margin vs. Size',
        hAxis: {title: 'Margin', viewWindow:{min:-.525,max:.525}},
        vAxis: {title: 'Size', viewWindow:{min:0,max:62}},
        colorAxis: {colors: ['white', 'blue', 'red'], legend: {position: 'none'}},
        bubble: {textStyle: {fontSize: 7}, opacity: .5}
      };
      
      if (year == 0){
      	options.bubble = {textStyle: {color: 'none'}, opacity: .25};
      }
      else if (year > 1998){
      	options.title = 'R:'+supData2000[year]['repSP']+' D:'+supData2000[year]['demSP'];
      }
      else{
      	options.title = 'R:'+supData[year]['repSP']+' D:'+supData[year]['demSP'];
      }

      var sChart = new google.visualization.BubbleChart(document.getElementById('series_chart'));
      sChart.draw(data, options);

}

