function showYear(yearType) {
	if (document.getElementById("selectYear"+yearType).style.display != "inline-block") {
		document.getElementById("selectYear"+yearType).style.display = "inline-block";
	}
	else {
		document.getElementById("selectYear"+yearType).style.display = "none";
	}
}


